import React from "react";
import { NavLink } from "react-router-dom";
import Header from "../components/Header";
import Navbar from "../components/NavBar";
import Card from "../components/Card";

const Start = () => {
  return (
    <div>
      <Navbar />
      <Header
        title={"Free Mental Health Assessments"}
        description={
          "Join our community and get access to exclusive content on mental wellness. Take a Free test and get Your Report."
        }
      />
      <div className="m-8 md:m-20 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        <Card title="Anxiety" src="img/Anxiety.jpg" to="/anxiety" />
        <Card title="Depression" src="img/Depression.jpg" to="/depression" />
        <Card title="Child Abuse" src="img/childAbuse.jpg" to="/child-abuse" />
        <Card
          title="Obsessive Compulsive Disorder"
          src="img/OCD.jpg"
          to="/ocd"
        />
        <Card
          title="Relationship"
          src="img/relationship.jpg"
          to="/relationship"
        />
        <Card title="Prolong Grief" src="img/grief.jpg" to="/grief" />
        <Card
          title="Post Traumatic Stress Disorder"
          src="img/ptsd.jpg"
          to="/ptsd"
        />
        <Card
          title="Attention Deficit Hyperactivity Disorder"
          src="img/adhd.jpg"
          to="/adhd"
        />
        <Card title="Clinical Anger" src="img/anger.jpg" to="/anger" />
      </div>
    </div>
  );
};

export default Start;
